import { useState } from 'react';
import { Stage, Layer, Rect } from 'react-konva';

function Main() {
    const [tab, setTab] = useState(Array.from({length: 20},()=> Array.from({length: 20}, () => null)));

    return (
      <div>
        <Stage width={window.innerWidth} height={window.innerHeight}>
          <Layer>
            {
                tab.map((row, i) => (
                    row.map((column, n) => (
                        <Rect
                        x={i * 100}
                        y={n * 100}
                        width={100}
                        height={100}
                        fill="white"
                        shadowBlur={10}
                        />
                    ))
                ))
            }
          </Layer>
        </Stage>
      </div>
    );
  }

export default Main;
